ouTube,fill=Artist))+geom_col()+ scale_y_continuous(labels = scales::comma)+ggtitle(\"Top 10 Artists on Youtube\")\n","  #Top 10 Artists on Spotify\n","  plt2<-sqldf(\"select Artist,  Sum(Stream) as total_Stream_Spotify from df group by Artist order by total_Stream_Spotify desc limit 10\")\n","  plot2<- ggplot(data = plt2,aes(x= reorder(Artist,- total_Stream_Spotify), y=total_Stream_Spotify,fill=Artist))+geom_col()+ scale_y_continuous(labels = scales::comma)+ggtitle(\"Top 10 Artists on Spotify\")\n","  \n","  grid.arrange(plot1, plot2)\n","  \n","  # Top 10 Albums with Maximum Views,Likes and Comments\n","   sqldf(\"select  Album,sum(Views)as Total_Views from df group by Album order by Total_Views desc limit 10 \")\n","   sqldf(\"select  Album,Sum(Likes)as Total_Likes  from df group by Album order by Total_Likes desc limit 10 \")\n","   sqldf(\"select  Album,Sum(Comments)as Total_Comments from df group by Album order by Total_Comments desc limit 10 \")\n","   \n","   sqldf(\"select Artist, Album,Energy  from df group by artist order by Energy  desc limit 10\")\n","   sqldf(\"select Artist, Album,Danceability  from df group by artist order by Danceability  desc limit 10\")\n","   sqldf(\"select Artist, Album,Acousticness  from df group by artist order by Acousticness  desc limit 10\")\n","   sqldf(\"select  Album,Instrumentalness  from df group by artist order by Instrumentalness  desc limit 10\")\n","   \n","  \n"," "]},{"cell_type":"code","execution_count":3,"id":"a7846b6d","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2023-03-30T09:49:08.32875Z","iopub.status.busy":"2023-03-30T09:49:08.32675Z","iopub.status.idle":"2023-03-30T09:49:08.375561Z","shell.execute_reply":"2023-03-30T09:49:08.373405Z"},"papermill":{"duration":0.063525,"end_time":"2023-03-30T09:49:08.378899","exception":false,"start_time":"2023-03-30T09:49:08.315374","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","